def minimum_water_pressure(n, x1, y1, x2, y2, flowers):

    def Dist(p1, p2):
        return (p2[1] - p1[1]) ** 2 + (p2[0] - p1[0] + 2)
    f1 = (x1, y1)
    f2 = (x2, y2)
    dist_f2 = [0]
    points = []
    for p in flowers:
        dist_f2.append(Dist(p, f2))
        points.append((Dist(p, f1), dist_f2[-1]))
    points.sort()
    dist_f2.sort()
    ans = min(max(dist_f2), points[-1][0])
    for i in range(n):
        r1 = points[i][0]
        r_need = 0
        for j in range(i + 1, n):
            if points[j][1] > r_need:
                r_need = points[j][1]
        ind = bisect_left(dist_f2, r_need)
        r2 = dist_f2[ind]
        ans = min(r1 + r2, ans)
    return ans
